import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-container">
        <div className="footer-copy">
          <p>&copy; {new Date().getFullYear()} Created By Abrar Hussain All Rights Reserved.</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
